import logo from './logo.svg';
import './App.css';

function App() {
  const name = null
  return (

    <div className="App">

      {
        name ? (
          <h1> {name} </h1>
          ):
          (
            <>
            <h1>
             None
            </h1>
            <h1>

            </h1>
            <img src = {logo} className = "App-logo"/>
            </>
            )
      }
    </div>

  );
}

export default App;
